import axios from 'axios';

class Calls {
    getRandomActivity() {
        axios.get('http://www.boredapi.com/api/activity')
            .then((res) => {
                return res.data;
            }, (err) => {
                console.log(err);
                return err;
            });
    }
}

export default new Calls();
